pragma solidity 0.6.12;
import {LendingPool} from "@aave/protocol-v2/contracts/protocol/lendingpool/LendingPool.sol";
import {LendingPoolAddressesProvider} from "@aave/protocol-v2/contracts/protocol/configuration/LendingPoolAddressesProvider.sol";

contract Aavetrage {

    LendingPoolAddressesProvider provider;
    address dai;

    constructor(address _provider, address _dai) public {
        provider = LendingPoolAddressesProvider(_provider);
        dai = _dai;
    }

    function peek() external returns(address[] memory) {
        LendingPool lendingPool = LendingPool(provider.getLendingPool());
        address[] memory activeReserves = lendingPool.getReservesList();
        return activeReserves;
    }

    // function guap() external {

